import React from 'react';
import Movie from './Movie';

const MovieList = ({ movies }) => {
  return (
    <div className='movie-list row'>
      {movies.map((movie, i) => {
        return <Movie movie={movie} key={i} />;
      })}
    </div>
  );
};

export default MovieList;
